import { style } from "@mui/system";
import React from "react";
import styled from "styled-components";

const OverView = () => {
  const Overview = styled.div``;
  const OverViewContainer = styled.div``;
  const Card = styled.div``;
  return (
    <Overview>
      <OverViewContainer>
        <Card></Card>
        <Card></Card>
        <Card></Card>
        <Card></Card>
      </OverViewContainer>
    </Overview>
  );
};

export default OverView;
